import React from 'react';
import { useNavigate } from 'react-router-dom';
import './SuccessPage.css'; // Переконайтесь, що файл CSS правильно підключений

const SuccessPage = () => {
  const navigate = useNavigate();

  return (
    <div className="success-container">
      {/* Галочка успіху */}
      <div className="checkmark-icon">
        <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" width="48" height="48">
          <circle cx="12" cy="12" r="10" fill="#4caf50"/>
          <path fill="none" stroke="#fff" strokeWidth="2" d="M6 12l4 4L18 8" />
        </svg>
      </div>

      <h1>Success!</h1>
      <p>Ваше замовлення надіслано на обробку! <br /> Перевірте вашу поштову скриньку для подальшої інформації.</p>
      <button onClick={() => navigate('/catalog')}>Повернутися до каталогу</button>
    </div>
  );
};

export default SuccessPage;
